import './App.css';

function App() {
  // Generate multiple grass blades
  const grassBlades = Array.from({ length: 30 }).map((_, i) => (
    <div
      key={i}
      className="grass-blade"
      style={{
        left: `${3 + i * 3}%`,
        height: `${30 + Math.random() * 30}px`,
        animationDelay: `${Math.random() * 2}s`,
      }}
    />
  ));

  // Generate multiple falling leaves
  const leaves = Array.from({ length: 10 }).map((_, i) => (
    <div
      key={i}
      className="falling-leaf"
      style={{
        left: `${Math.random() * 100}%`,
        animationDelay: `${Math.random() * 5}s`,
      }}
    >
      <svg width="24" height="24" viewBox="0 0 24 24">
        <ellipse cx="12" cy="12" rx="8" ry="4" fill="#8B5C2A" />
        <rect x="11" y="16" width="2" height="6" fill="#8B5C2A" />
      </svg>
    </div>
  ));

  return (
    <div className="App">
      {/* Grass at the bottom */}
      <div className="grass-container">
        {grassBlades}
      </div>
      {/* Falling leaves */}
      <div className="leaves-container">
        {leaves}
      </div>
    </div>
  );
}

export default App;
